    /><strong>Método 1 de división de fracciones: Multiplicar en cruz</strong
    ><span class="ez-toc-section-end" />
  </h2>
  <p>
    Este método consiste en multiplicar el numerador de la primera fracción por
    el denominador de la segunda y el resultado escribirlo en el numerador de la
    fracción resultante.
  </p>
  <p>
    Por otro lado, multiplicamos el denominador de la primera fracción por el
    numerador de la segunda y el resultado lo escribimos en el denominador de la
    fracción resultante.
  </p>
  <p>Por último se simplifica la fracción final.</p>
  <p>Por ejemplo, para dividir las fracciones 3/4 entre 6/10.</p>
  <div class="text-center">
    <img
    decoding="async"
    loading="lazy"
    class="aligncenter"
    src="data:image/png;base64,"
    alt="división de fracciones"
    width="131"
    height="56"
  />
  </div>
  <p>
    Multiplicamos el numerador de la primera (3) por el denominador de la
    segunda (10). De esta manera, nos queda en el numerador de la fracción final
    3×10 = 30
  </p>
  <p>
    Por otro lado, multiplicamos el denominador de la primera (4) por el
    numerador de la segunda (6). De esta manera, nos queda en el denominador de
    la fracción final 4×6 = 24
  </p>
  <div class="text-center">
    <img
    decoding="async"
    loading="lazy"
    class="aligncenter"
    src="data:image/png;base64,"
    alt="división de fracciones"
    width="164"
    height="65"
  />
  </div>
  <p>
    El último paso es simplificar la fracción. Como los dos números son
    múltiplos de 6 podemos dividir el numerador y el denominador entre 6.
  </p>
  <p>30 : 6 = 5</p>
  <p>24 : 6 = 4</p>
  <p>Por lo tanto, el resultado de la división es 5/4</p>
