      >Método 2&nbsp;de división de fracciones:&nbsp;Invertir y multiplicar</strong
    ><span class="ez-toc-section-end" />
  </h2>
  <ol>
    <li>
      Invertir la segunda fracción, es decir, cambiar el numerador por el
      denominador y viceversa.
    </li>
    <li>Simplificar cualquier numerador con cualquier denominador.</li>
    <li>Multiplicar en línea.</li>
  </ol>
  <p>
    Por ejemplo, vamos a dividir 12/5 entre 6/4.
    
    </p>
    <div class="text-center">
        <img
        decoding="async"
        loading="lazy"
        class="aligncenter"
        src="data:image/png;base64,"
        alt="división de fracciones"
        width="168"
        height="88"
      />
    </div>

  <p>Paso 1: Invertimos la segunda fracción 6/4. Esto se convierte en 4/6</p>
  <p>Paso 2: Simplificamos numeradores con denominadores.</p>
  <p>Los numeradores son:</p>
  <p>12 = 2x2x3</p>
  <p>4=2×2</p>
  <p>Los denominadores son:</p>
  <p>5=5</p>
  <p>6=2×3</p>
  <p>
    Podemos simplificar tanto del numerador como del denominador un 2 y un 3.
    Así nos queda, 2x2x2 / 5
  </p>
  <p>Paso 3: Multiplicamos en línea: 2x2x2 / 5 = 8/5</p>
